Step-by-step reasoning:
1. The key psychological mechanism in the Fehr–Schmidt model is inequality aversion. Responders experience disutility when the split is unequal, even if they receive a positive amount. In our dataset the responder’s share (split_self) is always greater than the proposer’s share (split_opp), so only the disutility from advantageous inequality (i.e., “guilt”) is relevant.
2. The psychological mechanism implies that the responder’s utility is not just the monetary gain but is penalized by the amount by which the responder’s payoff exceeds the proposer’s payoff. In this case, the “envy” parameter (which would penalize disadvantageous inequality) is not necessary since the condition split_self > split_opp always holds.
3. A mathematical formulation capturing this is to calculate the responder’s utility for accepting an offer as:
  U_accept = (split_self) − (beta)*(split_self − split_opp)
Here, split_self is the actual amount awarded to the responder from the offer; the term (split_self − split_opp) represents the deviation from an equal split, and beta is a learnable parameter that scales the disutility from this advantageous inequality.
4. This utility function maps directly to observable data: split_self and split_opp are provided in the dataset, and the model predicts responder behavior based on whether U_accept is sufficiently high relative to the alternative (which has a utility of zero). The decision-making process is thus driven by the trade-off between monetary gain and fairness.
5. Only one learnable parameter (beta) is included, and to mitigate issues with parameter recovery and high covariance, its bounds are made finite but generous.
6. The model is strictly designed for responder behavior in the Ultimatum Game under the assumption that inequality aversion from advantageous inequality is the primary driver for rejections.

The formal specification of the model is provided below.

<MODEL>
U = split_self - beta*(split_self - split_opp)
</MODEL>

